import { useState } from 'react';


function App() {
	const [counter, setCounter] = useState(0)
	let likes = 0
	function increment() {
		setCounter(likes += 1)
	}
	function decrement() {
		setCounter(likes -= 1)
	}
	return (
		<div className="App">
			<h1>{likes}</h1>
			<button onClick={() => increment}> increment</button>
			<button onClick={() => decrement}> decrement</button>
			console.log(likes)
		</div>
	);
}

export default App;
